INSERT INTO `os_doctor` VALUES (6, 222, '付中国', '13710833597', '0', '5', 34, 28.00, '0', 100, NULL, '主任医师，教授，北京大学人民医院骨创伤骨科副主任，硕士生导师', '肩关节痛及肩关节疾病，肩关节损伤修复，顽固性肩痛，肩关节假体置换功能重建手术等；上肢损伤修复与功能重建', '[[true,true,true],[false,false,false],[true,true,true],[false,false,false],[true,true,true],[false,false,false],[true,true,true]]', '2024-01-03 08:57:16', '2024-01-03 09:34:32');
