INSERT INTO `sys_dept` VALUES (100, 0, '0', '实力医院', 0, NULL, '实力', '15888888888', 'ry@qq.com', '0', '0', 'admin', '2023-11-15 14:11:32', 'admin', '2023-11-16 14:59:12');
INSERT INTO `sys_dept` VALUES (201, 100, '0,100', '内科', 1, '内科学的内容包含了疾病的定义、病因、致病机转、流行病学、自然史、症状、征候、实验诊断、影像检查、鉴别诊断、诊断、治疗、预后。内科学的方法是透过病史询问或面谈后，进行理学检查，根据病史与检查所见做实验诊断与影像检查，以期在众多鉴别诊断中排除可能性较低者，获得最有可能的诊断；获得诊断后，内科的治疗方法包含追踪观察、生活方式、药物、介入性治疗（如心导管、内视镜）等，根据病人的状况调整药物之使用，防止并处理副作用及并发症。', 'se', '13135219119', '2158139283@qq.com', '0', '0', 'admin', '2023-11-16 15:13:16', 'admin', '2023-11-20 17:49:34');
INSERT INTO `sys_dept` VALUES (202, 100, '0,100', '外科', 1, '外科(surgical department;surgery)医疗机构中主要用手术治疗疾病的一科; 主要用手术治疗体内外疾病的医学分科。与内科相对。', 'se', '13135219119', '2158139283@qq.com', '0', '0', 'admin', '2023-11-16 15:13:47', 'admin', '2023-11-20 19:48:56');
INSERT INTO `sys_dept` VALUES (203, 100, '0,100', '妇科', 1, '妇科是临床医学四大主要学科之一，主要研究女性生殖器官疾病的病因、病理、诊断及防治，妊娠、分娩的生理和病理变化，高危妊娠及难产的预防和诊治，女性生殖内分分泌，计划生育及妇女保健等。', 'se', '13135219119', '2158139283@qq.com', '0', '0', 'admin', '2023-11-16 15:15:24', 'admin', '2023-11-20 20:22:10');
INSERT INTO `sys_dept` VALUES (204, 100, '0,100', '预防保健科', 1, '预防保健科贯彻“预防为主”的工作方针，积极做好学生、教工保健、健康检查、对高血压病、冠心病、脑卒中、恶性肿瘤等慢性非传染性疾病的管理和监测、传染病管理和预防、心理卫生、健康教育、职业病防治等工作。', 'se', '13135219119', '2158139283@qq.com', '0', '0', 'admin', '2023-11-16 15:15:50', 'admin', '2023-11-20 19:50:37');
INSERT INTO `sys_dept` VALUES (205, 201, '0,100,201', '呼吸内科', 1, '呼吸内科是以肺部疾病的鉴别诊断、肺癌多学科综合治疗为特色的集医、教、研为一体的学术型科室', 'se', '13135219119', '2158139283@qq.com', '0', '0', 'admin', '2023-11-20 19:52:37', 'admin', '2023-11-28 09:11:22');
INSERT INTO `sys_dept` VALUES (207, 202, '0,100,202', '胃肠外科', 3, '对于食管癌和胃癌的治疗，我们采用多部门联合的方法。我们与临床肿瘤中心合作，让许多患者接受新辅助化疗／放疗，以及术后放化疗。', 'se', '18569521613', '3120793223@qq.com', '0', '0', 'admin', '2023-11-20 20:21:06', 'admin', '2023-11-29 17:42:35');
INSERT INTO `sys_dept` VALUES (208, 203, '0,100,203', '妇产科', 1, '妇产科是集妇科、产科、计划生育服务等于一体的综合性科室', 'se', '18569521613', '3120793223@qq.com', '0', '0', 'admin', '2023-11-20 20:23:23', '', NULL);
INSERT INTO `sys_dept` VALUES (209, 204, '0,100,204', '免疫预防科', 1, '主要承担辖区儿童的预防接种及保健工作', 'se', '18569521613', '3120793223@qq.com', '0', '0', 'admin', '2023-11-20 20:25:05', '', NULL);
INSERT INTO `sys_dept` VALUES (210, 202, '0,100,202', '皮肤病科', 2, '各种感染性皮肤病、甲病、性传播疾病及儿童皮肤病', '余进', NULL, NULL, '0', '0', 'admin', '2023-11-21 15:20:36', '', NULL);
INSERT INTO `sys_dept` VALUES (211, 100, '0,100', '挂号平台', 2, '微信挂号平台用户', '医健云', '13910733521', 'yyt@163.com', '0', '2', 'admin', '2023-11-29 09:20:07', '', NULL);
INSERT INTO `sys_dept` VALUES (212, 202, '0,100,202', '普通外科', 1, '普外科是以手术为主要方法治疗肝脏、胆道、胰腺、胃肠、肛肠、血管疾病、甲状腺和乳房的肿瘤及外伤等其它疾病的临床学科，是外科系统最大的专科。', 'se', '15538078796', '3483793802@qq.com', '0', '0', 'admin', '2023-11-29 17:42:24', 'admin', '2023-11-29 17:43:19');
INSERT INTO `sys_dept` VALUES (213, 202, '0,100,202', '神经外科', 4, '小儿神经外科是主治脑半球肿瘤、髓母细胞瘤、室管膜瘤、三脑室肿瘤、松果体肿瘤、颅咽管瘤、颅底肿瘤，以及髓内肿瘤、各种椎管内和脊柱肿瘤；包括先天性脑积水、脊髓和脊膜膨出、脊柱栓系综合症、小脑扁桃体下疝畸形、颅缝早闭、各种先天性颅颌面畸形。', 'se', '15538078796', '3483793802@qq.com', '0', '0', 'admin', '2023-11-29 17:44:41', '', NULL);
INSERT INTO `sys_dept` VALUES (214, 202, '0,100,202', '心胸外科', 5, '心胸外科还包含了心脏外科和普胸外科的疾病，心外科研究心脏大血管创伤、心包疾病、先天性心脏病、后天性心脏瓣膜病、缺血性心脏病、心脏肿瘤、大血管疾病、介入性治疗技术、心律失常的外科治疗、心脏起搏和植入式除颤复律器、动力性心肌成形术、心脏、肺和心肺移植等方面。', 'se', '15538078796', '3483793802@qq.com', '0', '0', 'admin', '2023-11-29 17:45:23', 'admin', '2023-11-29 17:46:14');
INSERT INTO `sys_dept` VALUES (215, 202, '0,100,202', '泌尿外科', 6, '泌尿科是专门研究男女泌尿道与男性生殖系统的一门医学，它主要是从外科细分而来。男性的泌尿与生殖系统密不可分，而女性的泌尿道则开口于外阴部。', 'se', '15538078796', '3483793802@qq.com', '0', '0', 'admin', '2023-11-29 17:46:50', 'admin', '2023-11-29 17:47:26');
INSERT INTO `sys_dept` VALUES (216, 202, '0,100,202', '心血管外科', 7, '心胸外科还包含了心脏外科和普胸外科的疾病，心外科研究心脏大血管创伤、心包疾病、先天性心脏病、后天性心脏瓣膜病、缺血性心脏病、心脏肿瘤、大血管疾病、介入性治疗技术、心律失常的外科治疗、心脏起搏和植入式除颤复律器、动力性心肌成形术、心脏、肺和心肺移植等方面。', 'se', '15538078796', '3483793802@qq.com', '0', '0', 'admin', '2023-11-29 17:47:59', 'admin', '2023-11-29 17:48:23');
INSERT INTO `sys_dept` VALUES (217, 202, '0,100,202', '乳腺外科', 8, '主要针对乳腺疾病的外科学方面：乳腺解剖、乳腺感染、乳腺肿瘤病理、乳腺肿瘤诊治原则、乳腺肿瘤诊断、乳腺肿瘤外科手术的各种术式、化疗、放疗、内分泌治疗。', 'se', '15538078796', '3483793802@qq.com', '0', '0', 'admin', '2023-11-29 17:48:48', 'admin', '2023-11-29 17:49:29');
INSERT INTO `sys_dept` VALUES (218, 202, '0,100,202', '肝胆外科', 9, '肝胆外科主要研究肝细胞癌、肝胆管结石、肝炎后肝硬化和重型肝炎所致的急性肝功能衰竭等严重威胁国人健康的重大疾病。', 'se', '15538078796', '3483793802@qq.com', '0', '0', 'admin', '2023-11-29 17:50:07', 'admin', '2023-11-29 17:50:28');
INSERT INTO `sys_dept` VALUES (219, 202, '0,100,202', '器官移植', 10, '器官移植 是将某个健康的器官通过手术或其他方法放置到一个患有严重疾病、危在旦夕的人身体上，让这个器官继续发挥功能，从而使接受捐赠者获得新生。', 'se', '15538078796', '3483793802@qq.com', '0', '0', 'admin', '2023-11-29 17:51:08', 'admin', '2023-11-29 17:51:39');
INSERT INTO `sys_dept` VALUES (220, 202, '0,100,202', '肛肠外科', 11, '肛肠外科是以手术为主要方法治疗发生于肛门和大肠部位的肿瘤、外伤及其他疾病的临床学科，肛肠疾病以发生在肛门直肠肠段最多见。', 'se', '15538078796', '3483793802@qq.com', '0', '0', 'admin', '2023-11-29 17:52:05', 'admin', '2023-11-29 17:52:23');
INSERT INTO `sys_dept` VALUES (221, 202, '0,100,202', '烧伤科', 12, '一般指热力，包括热液（水、汤、油等）、蒸气、高温气体、火焰、炽热金属液体或固体（如钢水、钢锭）等所引起的组织损害，主要指皮肤和/或黏膜，严重者也可伤及皮下或/和黏膜下组织，如肌肉、骨、关节甚至内脏。烫伤是由热液、蒸气等所引起的组织损伤，是热力烧伤的一种。', 'se', '15538078796', '3483793802@qq.com', '0', '0', 'admin', '2023-11-29 17:52:48', 'admin', '2023-11-29 17:53:47');
INSERT INTO `sys_dept` VALUES (222, 202, '0,100,202', '骨外科', 13, '骨外科是医疗机构的一个诊疗科目，是创伤、脊柱外科的总称，是以诊疗各种类型断指、断掌、多指离断的再植、各种类型皮瓣移植、神经修复术、四肢先天性畸形、臂丛神经损伤及神经卡压的诊治的专业科室。', 'se', '15538078796', '3483793802@qq.com', '0', '0', 'admin', '2023-11-29 17:54:04', 'admin', '2023-11-29 17:54:24');
INSERT INTO `sys_dept` VALUES (223, 201, '0,100,201', '血液内科', 2, '血液内科由北大医院内科血液组逐步发展而来，自1983年创科以来，在几任主任的带领下，血液内科逐步发展成为集血液系统疾病分子和细胞生物学诊断、治疗、造血干细胞移植和细胞免疫治疗于一体的科室', 'se', '15538078796', '3483793802@qq.com', '0', '0', 'admin', '2023-11-29 17:56:10', 'admin', '2023-11-29 17:57:00');
INSERT INTO `sys_dept` VALUES (224, 201, '0,100,201', '消化内科', 3, '消化内科是研究食管、胃、小肠、大肠、肝、胆及胰腺等疾病为主要内容的临床三级学科。消化内科疾病种类繁多，医学知识面广，操作复杂而精细。', 'se', '15538078796', '3483793802@qq.com', '0', '0', 'admin', '2023-11-29 17:56:33', 'admin', '2023-11-29 17:57:28');
